import React from 'react';

const SearchResults = ({ location, ageRange, serviceTypes }) => {
  // Implement result rendering logic based on selected options
  return (
    <div className="search-results">
      <h2>Search Results</h2>
      <p>Location: {location?.text}</p>
      <p>Age Range: {ageRange?.text}</p>
      <p>Service Types: {serviceTypes.map(st => st.text).join(', ')}</p>
      {/* Render actual results here */}
    </div>
  );
};

export default SearchResults;
